INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES ("2030/12/17 14:59:59", "訓練成功、おめでとうございます\n褒めるべき時にはしっかり褒めるのも\n教官の務めですものね。それとも、\n罵られる方が好みですか？　クスクス", 24, 0.0, 129901, 1, 100, 10.85, 10142, 7, 0.0, "2024/03/31 12:00:00", 100, "エリコ");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES ("2030/12/17 14:59:59", "厳しい訓練も、終わってみれば\n短く感じるものですわね。\n正直、私は暴れ足りないくらい…\nいえ、何でもありませんわ。クスクス", 24, 0.0, 129901, 1, 101, 11.15, 10142, 2, 0.0, "2024/03/31 12:00:00", 101, "エリコ");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES ("2030/12/17 14:59:59", "行く手を阻む忌々しい邪魔者を\n蹴散らして、見事ゴールイン…！\nまるで私とあのおかたの人生を\n象徴するような道のりでした…", 24, 0.0, 129901, 7, 102, 6.4, 10142, 5, 0.0, "2024/03/31 12:00:00", 102, "エリコ");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES ("2030/12/17 14:59:59", "まったくもって不甲斐ない結果です\nしかし、挽回の機会はまだありますわ\n次はゴミ虫の地位から脱却できるよう\n死力を尽くしなさい。いいですね？", 24, 0.0, 129901, 3, 103, 0.0, 10142, 3, 0.0, "2024/03/31 12:00:00", 103, "エリコ");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES ("2030/12/17 14:59:59", "クスクス…ああご心配なさらず\nなんとも情けない成績を残す輩には\nどんな罰が相応しいか、考えている\nだけですので…クスクスクス", 24, 0.0, 129901, 2, 104, 2.43, 10142, 8, 0.0, "2024/03/31 12:00:00", 104, "エリコ");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES ("2030/12/17 14:59:59", "私が教官として認められなければ、\nあのおかたを失望させてしまう…\nそれだけはあってはなりません\nあなた方も、わかっていますわね？", 24, 0.0, 129901, 4, 105, 9.08, 10142, 3, 0.0, "2024/03/31 12:00:00", 105, "エリコ");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES ("2030/12/17 14:59:59", "まずまずの結果ではありますが、\nこの程度で満足してもらっては\n困りますわ。エリコ班の一員として、\nより高みを目指していただきますので", 24, 0.0, 129901, 6, 106, 0.0, 10142, 6, 0.0, "2024/03/31 12:00:00", 106, "エリコ");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES ("2030/12/17 14:59:59", "私の指導を受けながら、この結果は…\nもっと真剣に考えねばなりませんね\nあなた方が怠けずにいるには、\nどんなしつけが必要かを…クスクス", 24, 0.0, 129901, 3, 107, 10.6, 10142, 8, 0.0, "2024/03/31 12:00:00", 107, "エリコ");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES ("2030/12/17 14:59:59", "ひとまず訓練をこなしたご褒美か、\n実力を出しきれたとは言えない罰か…\nみなさんにどちらを与えるべきか\n少し悩む結果ですわね", 24, 0.0, 129901, 6, 108, 7.54, 10142, 4, 0.0, "2024/03/31 12:00:00", 108, "エリコ");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES ("2030/12/17 14:59:59", "なかなかいい戦いぶりでしたわ\nこれもあなた方の頑張りと、何より\n優秀な教官である私の教育の賜物\nそうですわね？　クスクスクス…", 24, 0.0, 129901, 2, 109, 11.5, 10142, 7, 0.0, "2024/03/31 12:00:00", 109, "エリコ");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES ("2030/12/17 14:59:59", "これだけ進めたのならば合格点ですわ\nでも、もっと高みを目指したいと\n思っているのなら…さらなる訓練にも\n付き合って差し上げましょう", 24, 0.0, 129901, 2, 110, 8.83, 10142, 1, 0.0, "2024/03/31 12:00:00", 110, "エリコ");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES ("2030/12/17 14:59:59", "未熟で頼りなかったあなた方が、\n見違えるように成長しました\nなるほど…これこそが、教官冥利に\n尽きるという気持ちなのですね", 24, 0.0, 129901, 1, 111, 6.68, 10142, 2, 0.0, "2024/03/31 12:00:00", 111, "エリコ");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES ("2030/12/17 14:59:59", "まさかあなた方が、私の予想すら\n超える力を発揮するとは…驚きました\nもはやゴミ虫などではありません\n一人前の騎士として胸を張りなさい", 24, 0.0, 129901, 6, 112, 8.8, 10142, 2, 0.0, "2024/03/31 12:00:00", 112, "エリコ");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES ("2030/12/17 14:59:59", "クスクス、見事な働きです\nみなさんならできると信じていました\n他でもない私の指導を受けた、\nエリコ班の優秀な新兵なのですから", 24, 0.0, 129901, 2, 113, 8.9, 10142, 1, 0.0, "2024/03/31 12:00:00", 113, "エリコ");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES ("2030/12/17 14:59:59", "なんてすばらしい成績…！\n今日という日は『あのおかたを想い\nエリコが限界を超えた記念日』として\n歴史に刻まれることでしょう…！", 24, 0.0, 129901, 2, 114, 3.7, 10142, 5, 0.0, "2024/03/31 12:00:00", 114, "エリコ");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES ("2030/12/17 14:59:59", "よし、いい訓練になったな\nおまえたちもよく動けてたし、\nちゃんと成長できてると思うぜ\nその調子で頑張れよっ", 24, 0.0, 129801, 1, 200, 7.6, 10142, 2, 0.0, "2024/03/31 12:00:00", 200, "マコト");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES ("2030/12/17 14:59:59", "ひとまずゴールおめでとう！\nでも、努力は継続してこそだからな\nおまえたちにやる気があるなら、\n何度だって付き合ってやるよ", 24, 0.0, 129801, 2, 201, 2.25, 10142, 1, 0.0, "2024/03/31 12:00:00", 201, "マコト");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES ("2030/12/17 14:59:59", "行軍訓練はこれにて完了！\n…なーんて思ってないよな？\n学んだことが体に染みつくまで\n地道に繰り返すのが練習ってもんさ", 24, 0.0, 129801, 2, 202, 3.28, 10142, 1, 0.0, "2024/03/31 12:00:00", 202, "マコト");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES ("2030/12/17 14:59:59", "みんなに無理をさせちまったか…\nでもこれで諦めることはないぜ\n次はきっとうまくいく。そう信じて\n鍛え続ければ、道は開けるはずだ！", 24, 0.0, 129801, 4, 203, 2.98, 10142, 1, 0.0, "2024/03/31 12:00:00", 203, "マコト");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES ("2030/12/17 14:59:59", "こいつは悔しい結果だな…\nま、反省点はいろいろあったし\nひとつずつ乗り越えていこう\nあたしたちで力を合わせて、なっ！", 24, 0.0, 129801, 4, 204, 3.0, 10142, 1, 0.0, "2024/03/31 12:00:00", 204, "マコト");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES ("2030/12/17 14:59:59", "おまえたちはまだ未熟な訓練兵、\n失敗を必要以上に悔やむことはねえよ\nでも実戦じゃこうはいかないからな\n次は気合を入れ直していけよっ！", 24, 0.0, 129801, 1, 205, 10.3, 10142, 2, 0.0, "2024/03/31 12:00:00", 205, "マコト");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES ("2030/12/17 14:59:59", "これがおまえたちの全力？\nいやいや、そんなはずはないよなっ\nおまえらならもっと強くなれる！\nあたしが言うんだ、間違いないぜ！", 24, 0.0, 129801, 6, 206, 2.93, 10142, 1, 0.0, "2024/03/31 12:00:00", 206, "マコト");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES ("2030/12/17 14:59:59", "おまえたちの実力を考えりゃ、\nベストを尽くせたとは言えない成績だ\nなら、次やるべきことも決まってる\n気持ちを切り替えて、鍛え直すんだ！", 24, 0.0, 129801, 3, 207, 9.3, 10142, 1, 0.0, "2024/03/31 12:00:00", 207, "マコト");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES ("2030/12/17 14:59:59", "まだまだ課題がある内容だったな～\n無駄な動き、判断の遅れ…\nそういうのをしっかり直していけば、\n記録ももっと伸びるはずだっ", 24, 0.0, 129801, 4, 208, 6.9, 10142, 1, 0.0, "2024/03/31 12:00:00", 208, "マコト");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES ("2030/12/17 14:59:59", "ここまでいけりゃ、合格点！\nむしろ、最初の頼りなさを思えば\nすげえ成長してるんじゃねえか？\n胸を張れる結果だと思うぜっ！", 24, 0.0, 129801, 2, 209, 0.0, 10142, 2, 0.0, "2024/03/31 12:00:00", 209, "マコト");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES ("2030/12/17 14:59:59", "なかなかハードな訓練だったけど、\nみんなしっかりついてこられたな\n地道に続けた基礎トレの成果が\n形になってる、その証だぜっ", 24, 0.0, 129801, 1, 210, 5.95, 10142, 2, 0.0, "2024/03/31 12:00:00", 210, "マコト");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES ("2030/12/17 14:59:59", "今回の訓練もよく頑張ったな！\nしっかり休んで次に備えろよ！\nなんつーか、教え子が成長してくのを\n見るのは楽しいもんだな…", 24, 0.0, 129801, 2, 211, 6.73, 10142, 1, 0.0, "2024/03/31 12:00:00", 211, "マコト");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES ("2030/12/17 14:59:59", "おまえら、すげえじゃねえか！\nこれならもう、ひよっこ新兵なんて\n言えねえな。きっと騎士団でも\n大活躍間違いなしだぜ！", 24, 0.0, 129801, 2, 212, 0.0, 10142, 2, 0.0, "2024/03/31 12:00:00", 212, "マコト");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES ("2030/12/17 14:59:59", "敵との戦い方、状況判断の正確さ\n何より根性…どれも最高だったぞ！\nうかうかしてたら、教官のあたしまで\n追い抜かれちまうかもな…へへっ", 24, 0.0, 129801, 1, 213, 6.65, 10142, 2, 0.0, "2024/03/31 12:00:00", 213, "マコト");
INSERT INTO `v1_58e861055177dc9dde06f69061ec1a04e328d05671798dc05a49992a61c6d6c8` VALUES ("2030/12/17 14:59:59", "あたしの指導が良かった？\nいやいや、ここまで強くなれたのは、\n他でもないおまえたち自身が努力した\nおかげだよ。改めて…おめでとうっ！", 24, 0.0, 129801, 6, 214, 3.05, 10142, 1, 0.0, "2024/03/31 12:00:00", 214, "マコト");
